import React from 'react';
import './HowWeHelp.css';

function HowWeHelp() {
  return (
    <div className="how-we-help-section">
      <h2 className="yellow-text">How we help you?</h2>
      <p>
        We make HVAC systems <br />
        <span className="green-text">green</span>, <span className="orange-text">sustainable</span> & <span className="blue-text">highly effective</span>
      </p>
    </div>
  );
}

export default HowWeHelp;
